import React from 'react';
import './Menu.css';

const Menu = () => {
  const menuItems = [
    { name: "Cappuccino", price: "$4" },
    { name: "Espresso", price: "$3" },
    { name: "Latte", price: "$4.5" },
    { name: "Mocha", price: "$5" },
  ];

  return (
    <div id="menu" className="menu">
      <h2>Our Menu</h2>
      <ul className="menu-list">
        {menuItems.map((item, index) => (
          <li key={index}>
            <span>{item.name}</span>
            <span>{item.price}</span>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Menu;
